import Layout from '../components/Layout';

const Projects = () => (
    <Layout title="Projects">
      <div className="cover">
        <div className="hello">
          <h1>Projects</h1>
        </div>
      </div>
      <style jsx>{`
      .cover {
        position: relative;
        min-height: 510px;
        background: transparent url(/static/cover.jpg) no-repeat center center;
        background-size: cover;
        background-attachment: fixed;
        background-position: center;
        background-repeat: no-repeat;
        background-size: cover;
      }
      .hello {
        position: absolute;
        top: 30px;
        left: 60px;
        background: #fff;
        border-radius: 40px;
        padding: 30px;
        opacity: 100%;
        box-shadow: 
          12px 12px 12px 0 rgba(0,0,0,0.5)
      }
      .my-info {
        margin: 0 0 100px 0;
        padding: 0;
        list-style: none;
        font-size: 18px;
      }
      .name {
        font-weight: 700;
        font-size: 24px;
      }
      .about-text {
        color: #777;
        text-align: left;
        max-width: 800px;
        margin: 0 auto 100px;
        padding: 20px;
      }
      img {
        float: right;
        margin: 10px 0 20px 20px;
      }
      @media (max-width: 600px) {
        .about-text img {
          float: none;
          display: block;
          margin: 0 auto 30px;
        }
      }
    `}</style>
    </Layout>
  );

  export default Projects;
